-- Create a public bucket for car images
CREATE OR REPLACE FUNCTION create_public_bucket(bucket_name TEXT)
RETURNS void AS $$
BEGIN
  IF NOT EXISTS (SELECT 1 FROM storage.buckets WHERE name = bucket_name) THEN
    INSERT INTO storage.buckets (name, public) VALUES (bucket_name, true);
  END IF;
END;
$$ LANGUAGE plpgsql;

-- Call the function to create the bucket
SELECT create_public_bucket('car-images');





create table public.invoices (
  id text not null,
  type text,
  user_id text not null,
  subscription_id integer not null,
  status text null default 'pending'::text,
  amount integer not null,
  currency text null default 'XTR'::text,
  created_at timestamp with time zone null default now(),
  updated_at timestamp with time zone null default now(),
  metadata jsonb null default '{}'::jsonb,
  constraint invoices_pkey primary key (id),
  constraint invoices_user_id_fkey foreign KEY (user_id) references users (user_id) on delete CASCADE,
  constraint check_status check (
    (
      status = any (
        array['pending'::text, 'paid'::text, 'failed'::text]
      )
    )
  )
) TABLESPACE pg_default;

create index IF not exists invoices_user_id_idx on public.invoices using btree (user_id) TABLESPACE pg_default;

create index IF not exists invoices_status_idx on public.invoices using btree (status) TABLESPACE pg_default;

